INSERT INTO public.descricaonaturezalesao (id, codigo, descricao) VALUES (8, '702035000', 'Fratura');
INSERT INTO public.descricaonaturezalesao (id, codigo, descricao) VALUES (9, '702040000', 'Queimadura ou escaldadura - efeito de temperatura elevada. Efeito do contato com substância quente. Inclui queimadura por eletricidade, mas não inclui choque elétrico. Não inclui queimadura por substância química, efeito de radiação, queimadura de sol, incapacidade sistêmica como intermação, queimadura por atrito, etc.');
INSERT INTO public.descricaonaturezalesao (id, codigo, descricao) VALUES (10, '702042000', 'Queimadura química (lesão de tecido provocada pela ação corrosiva de produto químico, suas emanações, etc.)');
INSERT INTO public.descricaonaturezalesao (id, codigo, descricao) VALUES (11, '702045000', 'Efeito de radiação (imediato) - queimadura de sol e toda forma de lesão de tecido, osso ou fluido orgânico, por exposição à radiação');
INSERT INTO public.descricaonaturezalesao (id, codigo, descricao) VALUES (12, '702048000', 'Congelamento, geladura e outros efeitos da exposição à baixa temperatura');
INSERT INTO public.descricaonaturezalesao (id, codigo, descricao) VALUES (13, '702050000', 'Asfixia, estrangulamento, afogamento');
INSERT INTO public.descricaonaturezalesao (id, codigo, descricao) VALUES (14, '702055000', 'Intermação, insolação, cãibra, exaustão e outros efeitos da temperatura ambiente elevada - não inclui queimadura de sol ou outros efeitos de radiação');
INSERT INTO public.descricaonaturezalesao (id, codigo, descricao) VALUES (15, '702060000', 'Choque elétrico e eletroplessão (eletrocussão)');
INSERT INTO public.descricaonaturezalesao (id, codigo, descricao) VALUES (16, '702065000', 'Hérnia de qualquer natureza, ruptura');
INSERT INTO public.descricaonaturezalesao (id, codigo, descricao) VALUES (17, '702070000', 'Amputação ou enucleação');
INSERT INTO public.descricaonaturezalesao (id, codigo, descricao) VALUES (18, '702075000', 'Perda ou diminuição de sentido (audição, visão, olfato, paladar e tato, desde que não seja sequela de outra lesão)');
INSERT INTO public.descricaonaturezalesao (id, codigo, descricao) VALUES (19, '702080000', 'Concussão cerebral');
INSERT INTO public.descricaonaturezalesao (id, codigo, descricao) VALUES (20, '702090000', 'Lesão imediata, NIC');
INSERT INTO public.descricaonaturezalesao (id, codigo, descricao) VALUES (21, '704020000', 'Doença contagiosa ou infecciosa (tuberculose, brucelose, etc.)');
INSERT INTO public.descricaonaturezalesao (id, codigo, descricao) VALUES (22, '704030000', 'Pneumoconiose (silicose, asbestose, etc.)');
INSERT INTO public.descricaonaturezalesao (id, codigo, descricao) VALUES (23, '706090000', 'Outras lesões, NIC');
INSERT INTO public.descricaonaturezalesao (id, codigo, descricao) VALUES (24, '704040000', 'Dermatose (erupção, inflamação da pele, inclusive furúnculo, etc.). Geralmente provocada pelo contato direto com substâncias ou agentes sensibilizantes ou irritantes, tais como medicamentos, óleos, agentes biológicos, plantas, madeiras ou metais. Não inclui lesão provocada pela ação corrosiva de produtos químicos, queimadura por contato com substâncias quentes, efeito de exposição à radiação, efeito de exposição a baixas temperaturas ou inflamação ou irritação causada por fricção ou impacto');
INSERT INTO public.descricaonaturezalesao (id, codigo, descricao) VALUES (25, '704050000', 'Envenenamento sistêmico - condição mórbida sistêmica provocada por inalação, ingestão ou absorção cutânea de substância tóxica, que afete o metabolismo, o funcionamento do sistema nervoso, do aparelho circulatório, do aparelho digestivo, do aparelho respiratório, dos órgãos de excreção, do sistema músculo-esquelético, etc., inclui ação de produto químico, medicamento, metal ou peçonha. Não inclui efeito de radiação, pneumoconiose, efeito corrosivo de produto químico, irritação cutânea, septicemia ou caso de ferida infectada');
INSERT INTO public.descricaonaturezalesao (id, codigo, descricao) VALUES (26, '704060000', 'Perda ou diminuição mediatas de sentido (audição, visão, olfato, paladar e tato, desde que não seja sequela de outra lesão)');
INSERT INTO public.descricaonaturezalesao (id, codigo, descricao) VALUES (27, '704070000', 'Efeito de radiação (mediato) - queimadura do sol e toda forma de lesão de tecido, osso, ou fluido orgânico por exposição à radiação.');
INSERT INTO public.descricaonaturezalesao (id, codigo, descricao) VALUES (28, '704090000', 'Doença, NIC');
INSERT INTO public.descricaonaturezalesao (id, codigo, descricao) VALUES (29, '706050000', 'Lesões múltiplas');
