INSERT INTO public.geracao (id, nome, descricao, anoinicial, anofinal) VALUES (1, 'GERAÇÃO BABY BOOMER', 'O termo em inglês “Baby Boomer” pode ser traduzido livremente para o português como “explosão de bebês”, fenômeno social ocorrido nos Estados unidos no final da Segunda Guerra, ocasião em que os soldados voltaram para suas casas e conceberam filhos em uma mesma época. Foram pessoas educadas com muita disciplina e rigidez. Demonstram lealdade e compromisso com a empresa e valorizam a ascensão profissional. São pessoas que possuem o padrão de vida estável, dão preferência por qualidade e não quantidade, sabem o que quer e não são  influenciadas por terceiros.', 1940, 1960);
INSERT INTO public.geracao (id, nome, descricao, anoinicial, anofinal) VALUES (2, 'GERAÇÃO X', 'Valorizam o trabalho e estabilidade financeira. São independentes e empreendedores. São pessoas que buscam por seus direitos, procuram  liberdade e tem ruptura com as regras e valores da geração anterior. Enquanto a Geração Baby Boomer se apresenta como contemporânea ao nascimento da tecnologia a Geração X surge já fazendo uso dos recursos tecnológicos promovidos por sua geração precursora. No meio profissional essa geração é caracterizada atualmente por certas resistências em relação a tudo que é novo.', 1960, 1980);
INSERT INTO public.geracao (id, nome, descricao, anoinicial, anofinal) VALUES (3, 'GERAÇÃO Y', 'São pessoas que possuem características muito especiais, pois foram os únicos que acompanharam a revolução tecnológica desde pequenos. Eles se conectaram desde cedo com o mundo digital e aprenderam na raça como incorporar em seu cotidiano as novas tecnologias, conseguindo, assim, desenvolver competências diferentes das gerações anteriores: a Baby Boomers e Geração X.', 1980, 2000);
INSERT INTO public.geracao (id, nome, descricao, anoinicial, anofinal) VALUES (4, 'GERAÇÃO W', 'São pessoas que nasceram entre 1991 à 2000. Essa geração é uma subdivisão da Geração Y que quando foi criada, possuíam ainda jovens sem idade para o trabalho. Pessoalmente, acreditamos que essa nomenclatura venha ser deixada de lado, até porque, o W deve ser utilizado para a Geração Baby Boomer para padronizar uma letra para cada. O tempo dirá o que acontecerá, entretanto, é suficiente sabermos que são tão conectados quando qualquer um da Geração Y. Elas possuem as mesmas características da geração Y', 1991, 2000);
INSERT INTO public.geracao (id, nome, descricao, anoinicial, anofinal) VALUES (5, 'GERAÇÃO Z', 'Os jovens nascidos em meados dos anos noventa forma o conjunto da Geração Z. Estes ainda não estão inseridos no mercado de trabalho, mas já são motivo de reflexão por conta do seu comportamento individualista e de certa forma antissocial. Os jovens da Geração Z apresentam um perfil mais imediatista. Querem tudo para agora e não têm paciência com os mais velhos quando estes precisam de ajuda com algum equipamento eletrônico ou algum novo recurso da informática. Esse tipo de atitude sugere que tais jovens terão sérios problemas no mercado de trabalho, quando serão exigidas habilidades para se trabalhar em equipe. O trabalho coletivo demanda respeito e tolerância, virtudes em escassez nos jovens da Geração Z.', 1990, 2010);
INSERT INTO public.geracao (id, nome, descricao, anoinicial, anofinal) VALUES (6, 'GERAÇÃO ALFA (ALPHA)', 'São pessoas que nasceram após 2010. É uma geração que não está totalmente definida. A geração Z e a Alfa podem se fundir numa nova nomenclatura, porém, exatamente pela falta de definição, temporariamente é chamada de Geração Alfa. Ainda não tem característica precisa, o que se sabe é que nunca uma geração teve tanto acesso a informação e educação como esta. ', 2010, NULL);
